examples.question:
In the figure, the visible gray area within the larger circle is equal to three times the area of the white circular region. What is the ratio of the radius of the small circle to the radius of the large circle? Express your answer as a common fraction.

[asy]size(101);
filldraw(Circle((0,0),2)^^Circle((.8,-.3),1),gray(.6)+fillrule(1),black);[/asy]

Find the value of $a$ so that the lines with the given equations are perpendicular. \begin{align*}
y &= 2x+13 \\
6y+ax &= 6.
\end{align*}

Each letter represents a non-zero digit. What is the value of $t?$ \begin{align*}
c + o &= u \\
u + n &= t \\
t + c &= s \\
o + n + s &= 12
\end{align*}

In the figure, $m\angle A = 28^{\circ}$, $m\angle B = 74^\circ$ and $m\angle C = 26^{\circ}$. If $x$ and $y$ are the measures of the angles in which they are shown, what is the value of $x + y$? [asy]
size(150);
draw((0,5)--(0,0)--(15,0)--(15,5),linewidth(1));
draw((0,5)--(2,2)--(5,5)--(12,-2)--(15,5),linewidth(.7));
label("A",(0,5),N);
draw("B",(5,5),N);
draw("C",(15,5),N);
draw("$x^{\circ}$",(2.5,2.5),N);
draw("$y^{\circ}$",(12,-2),N);
draw((0,.5)--(.5,.5)--(.5,0),linewidth(.7));
draw((15,.5)--(14.5,.5)--(14.5,0),linewidth(.7));

[/asy]

As shown in the figure below, a circular park consists of an outer-ring path for walkers (white) and a ring-shaped flower garden (gray) surrounding a central circular fountain (black). The walking path is six feet wide in all places, the garden ring is eight feet wide in all places, and the fountain has a diameter of 10 feet. What is the diameter, in feet, of the circle that is the outer boundary of the walking path?

[asy]import graph;
size(101);
draw(Circle((0,0),19));
filldraw(Circle((0,0),13),gray(.6),black);
fill(Circle((0,0),5),black);
draw("$8'$",(0,5)--(0,13));
draw("$6'$",(13,0)--(19,0));
[/asy]

What is the area of the gray region, in square units, if the radius of the larger circle is four times the radius of the smaller circle and the diameter of the smaller circle is 2 units? Express your answer in terms of $\pi$. [asy]
size(150);
pair A, B;
A=(0,0);
B=(-4,1);
fill(circle(A, 8), gray(.7));
fill(circle(B, 2), white);
draw(circle(A, 8));
draw(circle(B, 2));
[/asy]

The graph of $y=f(x)$ for $-3\le x\le 3$ is shown below. On this interval, what is the range of $f(x)-x$? Express your answer in interval notation.

[asy]
size(150);
real ticklen=3;
real tickspace=2;

real ticklength=0.1cm;
real axisarrowsize=0.14cm;
pen axispen=black+1.3bp;
real vectorarrowsize=0.2cm;
real tickdown=-0.5;
real tickdownlength=-0.15inch;
real tickdownbase=0.3;
real wholetickdown=tickdown;
void rr_cartesian_axes(real xleft, real xright, real ybottom, real ytop, real xstep=1, real ystep=1, bool useticks=false, bool complexplane=false, bool usegrid=true) {

import graph;

real i;

if(complexplane) {

label("$\textnormal{Re}$",(xright,0),SE);

label("$\textnormal{Im}$",(0,ytop),NW);

} else {

label("$x$",(xright+0.4,-0.5));

label("$y$",(-0.5,ytop+0.2));

}

ylimits(ybottom,ytop);

xlimits( xleft, xright);

real[] TicksArrx,TicksArry;

for(i=xleft+xstep; i<xright; i+=xstep) {

if(abs(i) >0.1) {

TicksArrx.push(i);

}

}

for(i=ybottom+ystep; i<ytop; i+=ystep) {

if(abs(i) >0.1) {

TicksArry.push(i);

}

}

if(usegrid) {

xaxis(BottomTop(extend=false), Ticks("%", TicksArrx ,pTick=gray(0.22),extend=true),p=invisible);//,above=true);

yaxis(LeftRight(extend=false),Ticks("%", TicksArry ,pTick=gray(0.22),extend=true), p=invisible);//,Arrows);

}

if(useticks) {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, Ticks("%",TicksArry , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, Ticks("%",TicksArrx , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

} else {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, above=true, Arrows(size=axisarrowsize));

}
};
rr_cartesian_axes(-3,3,-3,3);
draw((-3,-3)--(-2,-3),red+1);
draw((-2,-2)--(-1,-2),red+1);
draw((-1,-1)--(0,-1),red+1);
draw((0,0)--(1,0),red+1);
draw((1,1)--(2,1),red+1);
draw((2,2)--(3,2),red+1);
dot((-3,-3),red); dot((-2,-2),red); dot((-1,-1),red); dot((0,0),red); dot((1,1),red); dot((2,2),red); dot((3,3),red);
dot((-2,-3),red,UnFill); dot((-1,-2),red,UnFill); dot((0,-1),red,UnFill); dot((1,0),red,UnFill); dot((2,1),red,UnFill); dot((3,2),red,UnFill);
[/asy]

Steve has an isosceles triangle with base 8 inches and height 10 inches. He wants to cut it into eight pieces that have equal areas, as shown below. To the nearest hundredth of an inch what is the number of inches in the greatest perimeter among the eight pieces? [asy]
size(150);
defaultpen(linewidth(0.7));
draw((0,0)--(8,0));
for(int i = 0; i < 9; ++i){
draw((4,10)--(i,0));
}
draw((0,-0.5)--(8,-0.5),Bars(5));
label("$8''$",(0,-0.5)--(8,-0.5),S);
[/asy]

The graph of $y = \frac{p(x)}{q(x)}$ is shown below, where $p(x)$ and $q(x)$ are quadratic.  (Assume that the grid lines are at integers.)

[asy]
unitsize(0.6 cm);

real func (real x) {
  return (2*(x - 1)/(x + 2));
}

int i;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0));
draw((0,-8)--(0,8));
draw((-2,-8)--(-2,8),dashed);
draw((-8,2)--(8,2),dashed);
draw(graph(func,-8,-2.1),red);
draw(graph(func,-1.9,8),red);
filldraw(Circle((5,func(5)),0.15),white,red);

limits((-8,-8),(8,8),Crop);
[/asy]

The horizontal asymptote is $y = 2,$ and the only vertical asymptote is $x = -2.$  Find $\frac{p(3)}{q(3)}.$

$ABCDEFGH$ shown below is a cube. Find $\sin \angle HAC$.

[asy]

import three;

triple A,B,C,D,EE,F,G,H;

A = (0,0,0);

B = (1,0,0);

C = (1,1,0);

D= (0,1,0);

EE = (0,0,1);

F = B+EE;

G = C + EE;

H = D + EE;

draw(B--C--D);

draw(B--A--D,dashed);

draw(EE--F--G--H--EE);

draw(A--EE,dashed);

draw(B--F);

draw(C--G);

draw(D--H);

label("$A$",A,S);

label("$B$",B,W);

label("$C$",C,S);

label("$D$",D,E);

label("$E$",EE,N);

label("$F$",F,W);

label("$G$",G,SW);

label("$H$",H,E);

[/asy]

