In Perfectville, the streets are all $20$ feet wide and the blocks they enclose are all squares of side length $400$ feet, as shown.  Sarah runs around the block on the $400$-foot side of the street, while Sam runs on the opposite side of the street.  How many more feet than Sarah does Sam run for every lap around the block?

[asy]
draw((0,0)--(10,0));
draw((1,1)--(9,1));
draw((0,0)--(0,10));
draw((0,10)--(10,10));
draw((10,10)--(10,0));
draw((9,1)--(9,9));
draw((9,9)--(1,9));
draw((1,9)--(1,1));
fill((1,1)--(1,9)--(9,9)--(9,1)--cycle,gray);
draw((9,10.5)--(9,11));
draw((10,10.5)--(10,11));
draw((9,10.75)--(10,10.75));
label("20'",(9.5,11),N);
draw((10.5,9)--(11,9));
draw((10.5,10)--(11,10));
draw((10.75,9)--(10.75,10));
label("20'",(11,9.5),E);
label("400'",(5,9),S);
label("400'",(9,5),W);
[/asy]

Below is a portion of the graph of a quadratic function, $y=q(x)=ax^2+bx+c$:

[asy]
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-0.99,xmax=10.5,ymin=-5.5,ymax=5.5;

pen cqcqcq=rgb(0.75,0.75,0.75);
/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return 4-(x-8)*(x-7)/8;}
draw(graph(f1,-0.99,10.5),linewidth(1));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);
label("$y=q(x)$",(10.75,2.5),E);
[/asy] The value of $q(15)$ is an integer. What is that integer?

Quadrilateral $ABCD$ is a square, and segment $AE$ is perpendicular to segment $ED$. If $AE = 8$ units and $DE = 6$ units, what is the area of pentagon $AEDCB$, in square units? [asy]
size(150);
pair A, B, C, D, E;
A=(0,10);
B=(0,0);
C=(10,0);
D=(10,10);
E=(6.4,5.2);
draw(A--B--C--D--A);
draw(A--E--D);
label("A", A, NW);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("E", E, S);
[/asy]

Points $K$, $L$, $M$, and $N$ lie in the plane of the square $ABCD$ so that $AKB$, $BLC$, $CMD$, and $DNA$ are equilateral triangles. If $ABCD$ has an area of 16, find the area of $KLMN$. Express your answer in simplest radical form.

[asy]
pair K,L,M,I,A,B,C,D;
D=(0,0);
C=(10,0);
B=(10,10);
A=(0,10);
I=(-8.7,5);
L=(18.7,5);
M=(5,-8.7);
K=(5,18.7);
draw(A--B--C--D--cycle,linewidth(0.7));
draw(A--D--I--cycle,linewidth(0.7));
draw(B--L--C--cycle,linewidth(0.7));
draw(A--B--K--cycle,linewidth(0.7));
draw(D--C--M--cycle,linewidth(0.7));
draw(K--L--M--I--cycle,linewidth(0.7));
label("$A$",A,SE);
label("$B$",B,SW);
label("$C$",C,NW);
label("$D$",D,NE);
label("$K$",K,N);
label("$L$",L,E);
label("$M$",M,S);
label("$N$",I,W);

[/asy]

